import Header from './Header';
import Head from 'next/head';


const Layout = props => (
    <div>
        <head>
            <title>IntelliShip</title>
            <link rel="stylesheet"
            href="https://bootswatch.com/4/lux/bootstrap.min.css"/>
        </head>
      <Header />
      {props.children}
    </div>
  );

export default Layout;
